const {ethers} = require("hardhat");
const {expect} = require("chai");
const {getTxReceipt} = require("../rpc/utils/tx.js");
const MAX_LONG_BYTES = ""

describe("failed intercepts tx", function () {
    this.timeout(1000000)
    let fromAddress;
    before(async function () {
        fromAddress = (await ethers.getSigners())[0].address
    })

    describe("Failed to verify the signature" , function () {

        it("hexString must has even length" , async () => {
            try {
                await ethers.provider.send("eth_sendRawTransaction", [""])
            } catch (e) {
                expect(e.toString()).to.be.contains("hexString must has even lengt")
            }
        })

        it("invalid remainder", async () => {
            try {
                await ethers.provider.send("eth_sendRawTransaction", [""])
            } catch (e) {
                expect(e.toString()).to.be.contains("invalid remainder")
            }
        })

        it("invalid RLP: not enough bytes for string", async () => {
            try {
                await ethers.provider.send("eth_sendRawTransaction", [""])
            } catch (e) {
                expect(e.toString()).to.be.contains("invalid RLP: not enough bytes for string")
            }
        })
    })


    it("from  unRegistered" , async () => {
        try {
            await ethers.provider.send("eth_sendRawTransaction", [""])
        } catch (e) {
            expect(e.toString()).to.be.contains("from id not found")
        }
    })

    it("to is eoa account", async () => {
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "to": "0x0c1efcca2bcb65a532274f3ef24c044ef4ab6d71",
                "gas": "0x99999",
                "gasPrice": "0x11",
                "value": "0x9184e72a",
                "data": "0xd46e8dd67c5d32be8d46e8dd67c5d32be8058bb8eb970870f072445675058bb8eb970870f072445675"
            }]);
        } catch (e) {
            expect(e.toString()).to.be.contains("to id not found")
        }
    })

    it("nonce too low or too high", async () => {
        console.log("nonce low")
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "nonce": "0x11",
                "data": ""
            }]);
        } catch (e) {
            expect(e.toString()).to.be.contains("invalid nonce")
        }
        console.log("nonce max")
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "nonce": "0x11111111",
                "data": ""
            }]);
        } catch (e) {
            console.log(e)
            expect(e.toString()).to.be.contains("invalid nonce")
        }
        console.log("nonce > nonce.max ")
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "nonce": "0x1111111111111",
                "data": ""
            }]);
        } catch (e) {
            expect(e.toString()).to.be.contains("l2_transaction.raw.nonce is 7 bytes long, expected length is 4!")
        }

    })

    it("tx size size is larger than the limit(https://github.com/nervosnetwork/godwoken-web3/issues/381)", async () => {
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                // "from": fromAddress,
                "gas": "0xfffff",
                "data": MAX_LONG_BYTES
            }]);
        } catch (e) {
            expect(e.toString()).to.be.contains("oversized data")
            return
        }
        expect("").to.be.equal("failed")

    })

    it("gasLimit too low(https://github.com/nervosnetwork/godwoken-web3/issues/382)", async () => {

        try {
             await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "gas": "0x1",
                "data": ""
            }]);
            expect("").to.be.equal("failed")
        }catch (e){
            expect(e.toString()).to.be.include("")
        }
    })

    it("gasLimit too max", async () => {
        let txHash = await ethers.provider.send("eth_sendTransaction", [{
            "from": fromAddress,
            "gas": "0x2faf080",
            "data": ""
        }]);
        console.log("response:", txHash)
        await getTxReceipt(ethers.provider, txHash, 10)

    })

    it("gasPrice = 0", async () => {

    })

    it(" balance is't sufficient to cover the fees and transfer amount(https://github.com/nervosnetwork/godwoken-web3/issues/385)", async () => {

        console.log("send tx that value > user's balance")
        try {
            await ethers.provider.send("eth_sendTransaction", [{
                // "from": fromAddress,
                "gas": "0x2fa000",
                "value": "0xffffffffffffffffffffffffffffff",
                "data": ""
            }]);
        } catch (e) {
            expect(e.toString()).to.be.include("insufficient")
            return;
        }
        expect("").to.be.equal("failed")


    })

    it("to is self(metamask Cancel the tx)", async () => {
        try {
            let txHash = await ethers.provider.send("eth_sendTransaction", [{
                "from": fromAddress,
                "to": fromAddress,
                "gas":"0x2faf0",
            }]);
            console.log("txHash:", txHash)
        } catch (e) {
            expect(e.toString()).to.be.include("to_address can not be EOA address")
            return
        }
        expect("").to.be.equal("failed")

    })


})